svg.script:
clearYard() <!-- To remove fill in yard-->
showColorbar()
showNone()


function showColorbar()
  { 
  var svgns = "http://www.w3.org/2000/svg";

      var col = ['#5E4FA2','#5654A6','#4F59AB','#495EAE','#4463B2','#3F68B5','#3B6DB7','#3873B9','#3578BB','#347DBC','#3282BD','#3287BD','#328CBD','#3492BB','#3797B9','#3B9DB7','#40A3B4','#46A9B1','#4CAEAD','#52B3AB','#58B8A8','#5EBDA6','#64C1A5','#69C4A5','#6FC7A5','#75CAA5','#7BCCA5','#81CFA5','#88D1A4','#8ED3A4','#95D5A4','#9BD7A4','#A2D9A4','#A8DCA4','#ADDEA4','#B3E0A3','#B9E3A2','#BFE5A1','#C5E8A0','#CBEA9E','#D1EC9D','#D6EE9B','#DBF09A','#DFF299','#E3F498','#E7F598','#EAF799','#EDF89C','#F0F9A0','#F3FAA4','#F6FBA9','#F8FCAF','#FBFDB4','#FCFEB8','#FEFFBC','#FFFFBE','#FFFFBF','#FFFFBE','#FFFDBC','#FFFCB8','#FFF9B4','#FFF6AE','#FFF3A8','#FEEFA2','#FEEC9C','#FEE896','#FEE491','#FEE18C','#FEDD88','#FED984','#FED580','#FED17C','#FECD78','#FEC874','#FEC470','#FDBF6C','#FDBA69','#FDB566','#FDB062','#FDAB5F','#FDA55C','#FCA058','#FC9A55','#FB9351','#FA8D4E','#F9874B','#F88148','#F77B46','#F67544','#F57043','#F36B43','#F26644','#F06244','#EE5E46','#EB5A47','#E85649','#E5524A','#E24E4C','#DF4A4D','#DB464E','#D8424F','#D43D4F','#D1384F','#CD334E','#C82E4E','#C4294D','#BF244C','#BA1E4B','#B5184A','#AF1348','#AA0D46','#A40744','#9E0142']
      for(var y = 1; y < 112; y++){

        var rect = document.createElementNS(svgns, 'rect'); 
        rect.setAttributeNS(null, 'y', '-50');
        let num = 6*y-60
        rect.setAttributeNS(null, 'x', num.toString());
        rect.setAttributeNS(null, 'height', '10');
        rect.setAttributeNS(null, 'width', '7');
        rect.setAttributeNS(null, 'fill', col[y]);
        document.getElementById('colorbar').appendChild(rect);
      }

      for (var y = 0; y < 12; y++){
        var rect = document.createElementNS(svgns, 'text'); 
        rect.setAttributeNS(null, 'y', '-20');
        let num = 60*y-60+10
        rect.setAttributeNS(null, 'x', num.toString());
        rect.setAttributeNS(null, 'text-anchor',"middle");
        let year = y*10+1910
        rect.textContent = year.toString();
        document.getElementById('colorbar').appendChild(rect);
      }
  }

        function clearUnderline(){
            var el = document.getElementsByClassName("architects")
            for(var i = 0; i < el.length; i++){
				el[i].style.setProperty("text-decoration","");
            } 
        }
        function clearHouseColoring(){
            document.getElementById("colorbar").style.display = "none";
            var el = document.getElementsByClassName("house")
            for(var i = 0; i < el.length; i++){
				el[i].style.fill = "#a8a8a8";
                el[i].style.setProperty("stroke-opacity",0);
            }    
        }
        function addHouseColoring(name,color){
            var el = document.getElementsByClassName(name)
            for(var i = 0; i < el.length; i++){
				el[i].style.fill = color;
            }
        }
        function addHouseStroke(name,color){        
            var el = document.getElementsByClassName(name)
            for(var i = 0; i < el.length; i++){
				el[i].style.stroke = color;
                el[i].style.setProperty("stroke-opacity",1);
            } 
        }
        function clearYard(){        
            var el = document.getElementsByClassName("yard")
            for(var i = 0; i < el.length; i++){
                el[i].style.fill = "#fcf5e3";
            } 
        }        

        function showNone() {            
            clearHouseColoring()
            addHouseColoring("Uchida","black")
            addHouseColoring("UchidaKishida","black")
            addHouseColoring("Kishida","black")
            addHouseColoring("Yamaguchi","black")
            addHouseColoring("Tange","black")
            addHouseColoring("Otani","black")
            addHouseColoring("Ando","black")
            addHouseColoring("Maki","black")
            addHouseColoring("Yoshitake","black")
            addHouseColoring("Maekawa","black")
            addHouseColoring("Murai","black")
            addHouseColoring("KishidaShogo","black")
            addHouseColoring("Kawano","black")
            addHouseColoring("Koyama","black")             
            clearUnderline()
            clearYard()             
            document.getElementById("labelNone").style.setProperty("text-decoration","underline");
        }

        function showA() {   
            clearHouseColoring()         
            addHouseColoring("Uchida","#2d54a1")
            addHouseColoring("UchidaKishida","url(#mixUK)")
            addHouseColoring("Kishida","black")
            addHouseColoring("Yamaguchi","violet")
            addHouseColoring("Tange","green")
            addHouseColoring("Otani","cyan")
            addHouseColoring("Ando","darkcyan")
            addHouseColoring("Maki","lightgreen")
            addHouseColoring("Yoshitake","gold")
            addHouseColoring("Maekawa","orange")
            addHouseColoring("Murai","orangered") 
            addHouseColoring("KishidaShogo","darkred")
            addHouseColoring("Kawano","darkviolet")
            addHouseColoring("Koyama","red")
            addHouseStroke("RenKoyama","red")             
            clearUnderline()
            document.getElementById("labelA").style.setProperty("text-decoration","underline");
        }

        function showU() {
            clearHouseColoring()
            addHouseColoring("Uchida","#2d54a1")
            addHouseColoring("UchidaKishida","url(#mixUK)")                     
            clearUnderline()
            document.getElementById("labelU").style.setProperty("text-decoration","underline");         	         	
        }

        function showY() {
            clearHouseColoring()             
            addHouseColoring("Yamaguchi","violet")         
            clearUnderline()
            document.getElementById("labelY").style.setProperty("text-decoration","underline");           	         	
        }

        function showT() {
            clearHouseColoring()             
            addHouseColoring("Tange","green")         
            clearUnderline()
            document.getElementById("labelT").style.setProperty("text-decoration","underline");           	         	
        }     

        function showO() {
            clearHouseColoring()             
            addHouseColoring("Otani","cyan")         
            clearUnderline()
            document.getElementById("labelO").style.setProperty("text-decoration","underline");           	         	
        }      

        function showAndo() {
            clearHouseColoring()             
            addHouseColoring("Ando","darkcyan")         
            clearUnderline()
            document.getElementById("labelAndo").style.setProperty("text-decoration","underline");           	         	
        }      

        function showMaki() {
            clearHouseColoring()             
            addHouseColoring("Maki","lightgreen")         
            clearUnderline()
            document.getElementById("labelMaki").style.setProperty("text-decoration","underline");           	         	
        }      

        function showYoshitake() {
            clearHouseColoring()             
            addHouseColoring("Yoshitake","gold")         
            clearUnderline()
            document.getElementById("labelYoshitake").style.setProperty("text-decoration","underline");           	         	
        }     

        function showMaekawa() {
            clearHouseColoring()             
            addHouseColoring("Maekawa","orange")         
            clearUnderline()
            document.getElementById("labelMaekawa").style.setProperty("text-decoration","underline");           	         	
        }       

        function showMurai() {
            clearHouseColoring()             
            addHouseColoring("Murai","orangered")         
            clearUnderline()
            document.getElementById("labelMurai").style.setProperty("text-decoration","underline");           	         	
        }     

        function showKishidaShogo() {
            clearHouseColoring()             
            addHouseColoring("KishidaShogo","darkred")         
            clearUnderline()
            document.getElementById("labelKishidaShogo").style.setProperty("text-decoration","underline");           	         	
        }   

        function showKawano() {
            clearHouseColoring()             
            addHouseColoring("Kawano","darkviolet")         
            clearUnderline()
            document.getElementById("labelKawano").style.setProperty("text-decoration","underline");           	         	
        }                                       

        function showK() {
            clearHouseColoring()             
            addHouseColoring("Koyama","red")
            addHouseStroke("RenKoyama","red")
            clearUnderline()
            document.getElementById("labelK").style.setProperty("text-decoration","underline");             	         	
        }  

        function showKi() {
            clearHouseColoring()
            addHouseColoring("UchidaKishida","url(#mixUK)")               
            addHouseColoring("Kishida","black")
            clearUnderline()           	
            document.getElementById("labelKi").style.setProperty("text-decoration","underline");            	
        }               


        function showYear() {
            var el = document.getElementsByClassName("year")
            for(var i = 0; i < el.length; i++){
				el[i].style.display = "block";
            }
            document.getElementById("showYear").style.display = "none";
            document.getElementById("hideYear").style.display = "block";
        }        
        function hideYear() {
            var el = document.getElementsByClassName("year")
            for(var i = 0; i < el.length; i++){
				el[i].style.display = "none";
            }
            document.getElementById("showYear").style.display = "block";
            document.getElementById("hideYear").style.display = "none";
        }    




        function yearColor() {
            var col = ['#5E4FA2','#5654A6','#4F59AB','#495EAE','#4463B2','#3F68B5','#3B6DB7','#3873B9','#3578BB','#347DBC','#3282BD','#3287BD','#328CBD','#3492BB','#3797B9','#3B9DB7','#40A3B4','#46A9B1','#4CAEAD','#52B3AB','#58B8A8','#5EBDA6','#64C1A5','#69C4A5','#6FC7A5','#75CAA5','#7BCCA5','#81CFA5','#88D1A4','#8ED3A4','#95D5A4','#9BD7A4','#A2D9A4','#A8DCA4','#ADDEA4','#B3E0A3','#B9E3A2','#BFE5A1','#C5E8A0','#CBEA9E','#D1EC9D','#D6EE9B','#DBF09A','#DFF299','#E3F498','#E7F598','#EAF799','#EDF89C','#F0F9A0','#F3FAA4','#F6FBA9','#F8FCAF','#FBFDB4','#FCFEB8','#FEFFBC','#FFFFBE','#FFFFBF','#FFFFBE','#FFFDBC','#FFFCB8','#FFF9B4','#FFF6AE','#FFF3A8','#FEEFA2','#FEEC9C','#FEE896','#FEE491','#FEE18C','#FEDD88','#FED984','#FED580','#FED17C','#FECD78','#FEC874','#FEC470','#FDBF6C','#FDBA69','#FDB566','#FDB062','#FDAB5F','#FDA55C','#FCA058','#FC9A55','#FB9351','#FA8D4E','#F9874B','#F88148','#F77B46','#F67544','#F57043','#F36B43','#F26644','#F06244','#EE5E46','#EB5A47','#E85649','#E5524A','#E24E4C','#DF4A4D','#DB464E','#D8424F','#D43D4F','#D1384F','#CD334E','#C82E4E','#C4294D','#BF244C','#BA1E4B','#B5184A','#AF1348','#AA0D46','#A40744','#9E0142']
            clearUnderline()
            clearHouseColoring()
            document.getElementById("colorbar").style.display = "block";

            document.getElementById("labelColor").style.setProperty("text-decoration","underline");  
            for(var y = 1900; y < 2022; y++){
                var el = document.getElementsByClassName("y"+y)
                for(var i = 0; i < el.length; i++){
			    	el[i].style.fill = col[y-1910];
                }
            }

        }
